import React, { Component } from 'react';
import './index.css';
import { Switch,Route,Redirect } from 'react-router-dom';

class App extends Component {
  render() {
    return (
      <div>
        <Switch>
        <Route path="/game" Component = {Game}></Route>
        <Redirect from="/" exact to="/game" />
        </Switch>
      </div>
    );
  }
}

export default App;
